"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?35/20/36163/abstract/1\">",
"      DOOLAN PD, ALPEN EL, THEIL GB. A clinical appraisal of the plasma concentration and endogenous clearance of creatinine. Am J Med 1962; 32:65.",
"     </a>",
"    </li>",
"    <li>",
"     Guyton AC. Textbook of Medical Physiology, 8th ed., Saunders, Philadelphia, 1991, chap. 16.",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?35/20/36163/abstract/3\">",
"      Maddox DA, Deen WM, Brenner BM. Dynamics of glomerular ultrafiltration. VI. Studies in the primate. Kidney Int 1974; 5:271.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?35/20/36163/abstract/4\">",
"      Brenner BM, Humes HD. Mechanics of glomerular ultrafiltration. N Engl J Med 1977; 297:148.",
"     </a>",
"    </li>",
